import './App.css';

function App() {
  return (
    <div className="App">
     <div className='border border-3'>
      <h1>Employee Management System</h1>
       <button className='btn btn primary'>Register</button>
       <button className='btn btn success mxs-3'>Login</button>
      </div> 
    </div>
  );
}

export default App;
